import React from "react";
import { Login } from "../auth/Login";
import { Register } from "../auth/Register";
import { NavbarContainer } from "../Navbar";
import { Logo } from "../Logo";
import { Link } from "react-router-dom";
import { LoginButton } from "../UI/Buttons";
import styled from "styled-components";

const BackButton = styled(LoginButton)`
  width: 160px;
`;

export const PrivateSection: React.FC<{
  activity: "registration" | "login";
}> = ({ activity }) => {
  return (
    <>
      <NavbarContainer>
        <Link to="/">
          <Logo />
        </Link>
        <Link to="/">
          <LoginButton>Back to quizzes</LoginButton>
        </Link>
      </NavbarContainer>
      {activity === "login" ? <Login /> : <Register />}
    </>
  );
};
